import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import TextField from '@material-ui/core/TextField';

const PostUser = () => {

    const [addUser, setAddUser] = useState({
        name: '',
        username:'',
        emailid:'',
        mobileno:''
    })

        
    const {name, username, emailid, mobileno} = addUser;

    const onSubmit = (event) => {
        event.preventDefault();

    }

    const onInputChange = (event) => {
       console.log( event.target.value)

    }

    return(
        <>

        <div className="container mt-5 mb-5 vh-00">
            <div className="row">
                <div className="m-auto col-md-6">
                    <div className="form_ui">
                    <h4>Add Users</h4>
                    <div className="form-group">
                    <TextField onChange={onInputChange} id="standard-basic" value={name} name="name" label="Name" className="w-100" />
                    </div>
                    <div className="form-group">
                    <TextField onChange={onInputChange} id="standard-basic" value={username} name="username"  className="w-100" label="User Name" />
                    </div>
                    <div className="form-group">
                    <TextField onChange={onInputChange} id="standard-basic" value={emailid} name="emailid" className="w-100" label="Email ID." />
                    </div>
                    <div className="form-group">
                    <TextField onChange={onInputChange} id="standard-basic" value={mobileno} name="mobileno" className="w-100" label="Mobile No." />
                    </div>
                    <div className="form-group pt-2">
                    <Button onClick={onSubmit} variant="contained" color="primary">Sumit</Button>
                    </div>
                    </div>
                </div>
            </div>
        </div>

      
        
        </>
    )
}

export default PostUser;
